import React from 'react';
import{ Button,Form,FromGroup,Label,Input, FormGroup} from 'reactstrap';
import Register from './Register';
import axios from "axios";

function Login() {

  return(
    <div className="bar">
   <Form onSubmit = {(e) =>login(e)} className ="login-form">
   <h1 className="font-weight-bold"> mywebside.com  </h1>
   <h2>Welcome</h2>
   <FormGroup>
    <Label>Email</Label>
     <input type="email" placeholder="Email" id ="exampleInputEmail"></input>
    </FormGroup>
    <FormGroup>
    <Label>Password</Label>
     <input type="password" placeholder="Password" id ="exampleInputPassword" ></input>
    </FormGroup>
    <Button onPress={() => this.props.navigation.navigate("Register")} className="btn-lg btn-dark btn-block">Login</Button>
  </Form>
  </div>

  );
  }

  function login(e){
    e.preventDefault();
     let request ={
       email:document.getElementById('exampleInputEmail').value,
       password:document.getElementById('exampleInputPassword').value
     }
     axios.get('http://192.168.8.101:3001/api/auth/login',request).then(
       resp => {
         alert(resp.data.message);
       })
       .catch(err =>{
         console.log(err);
       })
  }


  export default Login;
